import { Link } from "react-router-dom";

function Home(){
    return <div style={{display:"flex", flexDirection:"column", alignItems:"center"}}>

        <h1 style={{justifyContent:"center"}}>NTU AIML Club</h1>

        <h2>What the club is about and goals</h2>


        <Link to="/Events"><h2>Check out our upcoming events</h2></Link>

        <h2>How to contact and join the club</h2>
    </div>
}

export default Home;
